import React from 'react';
import './MemoryDetail.css';
import fishingImage from '../assets/image=img4.png';
import flowerIcon from "../assets/size=16.png";
import editIcon from "../assets/icon=edit.png";
import deleteIcon from "../assets/icon=delete.png";

const MemoryDetail = () => {
    return (
      <div className="memory-detail-page">
        <MemoryHeader />
        <MemoryContent />
        <CommentSection />
      </div>
    );
};

const MemoryHeader = () => {
    return (
      <div className="memory-header-section">
        <div className="memory-meta">
          <div>
            <span className="memory-category">달봉이아들</span>
            <span className="memory-divider"> | </span>
            <span className="memory-visibility">공개</span>
          </div>
          <div className="memory-actions">
            <button className="edit-memory">추억 수정하기</button>
            <button className="delete-memory">추억 삭제하기</button>
          </div>
        </div>
        <h1 className="memory-title">
          인천 앞바다에서 무려 60cm 월척을 낚다!
        </h1>
        <div className="memory-tags">
          <span className="memory-tag">#인천</span>
          <span className="memory-tag">#낚시</span>
        </div>
        <div className="memory-header-bottom">
          <div>
            <span className="memory-date">인천 앞바다 · 24.01.19 18:00</span>
            <span className="memory-likes">
              <img src={flowerIcon} alt="꽃 아이콘" className="flower-icon" /> 120
            </span>
            <span className="memory-comments"> 💬 8</span>
          </div>
          <div className="send-like-container">
            <button className="send-like">
              <img src={flowerIcon} alt="꽃 아이콘" className="flower-icon" /> 공감 보내기
            </button>
          </div>
        </div>
      </div>
    );
};

const MemoryContent = () => {
    return (
      <div className="memory-content">
        <img
          src={fishingImage}
          alt="낚시하는 모습"
          className="memory-image"
        />
        <p className="memory-text">
          인천 앞바다에서 월척을 낚았습니다!
          <br />
          가족들과 
        </p>
      </div>
    );
};

const CommentSection = () => {
    return (
      <div className="comment-section">
        <CommentForm />
        <CommentList />
      </div>
    );
};

const CommentForm = () => {
    return (
      <div className="comment-form">
        <button className="comment-submit-button">댓글 등록하기</button>
      </div>
    );
};

const CommentList = () => {
    const comments = [
        { id: 1, name: '달봉이아빠', date: '24.01.18 21:50', text: '댓글 내용' },
        { id: 2, name: '참가자', date: '24.01.18 21:50', text: '댓글 내용' },
        { id: 3, name: '참견러', date: '24.01.18 21:50', text: '댓글 내용' },
    ];

    return (
      <div className="comment-list">
        {comments.map((comment) => (
          <div className="comment-item" key={comment.id}>
            <div className="comment-meta">
              <span className="comment-author">{comment.name}</span>
              <span className="comment-date">{comment.date}</span>
            </div>
            <p className="comment-text">{comment.text}</p>
            <div className="comment-actions">
              <img src={editIcon} alt="수정 아이콘" className="comment-edit-icon" />
              <img src={deleteIcon} alt="삭제 아이콘" className="comment-delete-icon" />
            </div>
          </div>
        ))}
      </div>
    );
};

export default MemoryDetail;
